import React from 'react';

function Product({ roduct }) {
  return (
    <div>
      <b>{user.username}</b> <span>({user.email})</span>
    </div>
  );
}

function AlarmList() {
  const users = [
    {
      id: 1,
      releasedate: '20211229',
      productname: '나이키 조던 1 레트로 하이 OG',
    },

    {
      id: 2,
      releasedate: '20211230',        
      productname: '아디다스 이지 부스트',
    },

    {
      id: 2,
      releasedate: '20211231',        
      productname: '뉴발란스 993',
    },
  ];

  return (
    <div>
      {users.map(user => (
        <User user={user} key={user.id} />
      ))}
    </div>
  );
}

export default AlarmList;
